import gql from 'graphql-tag';

const USERS_ITEMS_QUERY = gql`
  query USERS_ITEMS_QUERY {
    currentUserItems {
      itemsByOwnerId(orderBy: ID_DESC) {
        nodes {
          id
          product
          quantity
          status
        }
      }
    }
  }
`;

export { USERS_ITEMS_QUERY };
